import { getUserInfo } from "./endpoints.js";
export const customerName = async () => {
    const userData = await getUserInfo();
    const userDataSlitted = userData.attributes.username.split('@');
    const userCustomer = userDataSlitted[1].split('.')[0];
    return userCustomer;
};
export const currentDate = () => {
    let DT = new Date();
    const date = DT.getDate();
    const month = DT.getMonth() + 1;
    const year = DT.getFullYear();
    const DATE = ('0' + date).slice(-2) + '/' +
        ('0' + month).slice(-2) + '/' +
        year;
    return DATE;
};
